def scramble(L):
    A = L
    i = 2
    while (i < len(A)):
        A[i - 2] += A.pop(i - 1)
        A[i - 1].append(A[:i - 2])
        i += 1

    return L
def solve(enc_flag,enc_numbers,res):
    assert len(enc_flag)==len(enc_numbers)
    for a,b in zip(enc_flag,enc_numbers):
        assert type(a)==type(b)
        if type(a)==list:
            solve(a,b,res)
        else:
            res[int(b)]=chr(int(a[2:],16))
